import {MDBContainer} from 'mdbreact';
import React from 'react';
import {Line} from 'react-chartjs-2';
import config from './components/config/defaultblueprint.json';

const bp = config.chartInfo.dataLine;

const LineChartV = () => {
  return (
    <MDBContainer>
      <h3 className="mt-5">Activity</h3>
      <Line width={bp.width} data={bp} options={{responsive: true}} />
    </MDBContainer>
  );
};

export default LineChartV;
